import React, { useRef, useLayoutEffect } from 'react'
import styled from 'styled-components'
import gsap from 'gsap'
import ScrollTrigger from 'gsap/ScrollTrigger'
import MyCard from './MyCard'
import img1 from '../../assets/LessonTopics/1.png'
import img2 from '../../assets/LessonTopics/2.png'
import img3 from '../../assets/LessonTopics/3.png'
import img4 from '../../assets/LessonTopics/4.png'
import img5 from '../../assets/LessonTopics/5.png'
import img6 from '../../assets/LessonTopics/6.png'
import img7 from '../../assets/LessonTopics/7.png'
import img8 from '../../assets/LessonTopics/8.png'
import img9 from '../../assets/LessonTopics/9.png'
import img10 from '../../assets/LessonTopics/10.png'
import img11 from '../../assets/LessonTopics/11.png'
import img12 from '../../assets/LessonTopics/12.png'
import img13 from '../../assets/LessonTopics/13.png'
import img14 from '../../assets/LessonTopics/14.png'
import img15 from '../../assets/LessonTopics/15.png'
import img16 from '../../assets/LessonTopics/16.png'
import img17 from '../../assets/LessonTopics/17.png'
import img18 from '../../assets/LessonTopics/18.png'
import img19 from '../../assets/LessonTopics/19.png'
import img20 from '../../assets/LessonTopics/20.png'
import img21 from '../../assets/LessonTopics/21.png'
import img22 from '../../assets/LessonTopics/22.png'
import img23 from '../../assets/LessonTopics/23.png'
import img24 from '../../assets/LessonTopics/24.png'
import { Grid } from '@mui/material'

const Section = styled.section`
// min-height: 80vh;
width: 100%;
background-color: ${props => props.theme.body};
display: flex;
justify-content: center;
align-items: center;
position: relative;
flex-direction: column;
`
const CardContainer = styled.div`
width: 60%;
background-color: ${props => props.theme.body};
display: flex-start;
justify-content: center;
align-items: center;
position: relative;
padding: 3%;
`

const Topics = () => {

    const ref = useRef(null);
    gsap.registerPlugin(ScrollTrigger);
    useLayoutEffect(() => {
      
        let element = ref.current;
        ScrollTrigger.create({
            id: 'slideID',
            trigger: element,
            start: 'bottom bottom',
            end: 'bottom top',
            pin: true,
            pinSpacing: false,
            scrub: true,
        })
    
      return () => {
        ScrollTrigger.getById('slideID').kill();
      };
    }, [])
  return (
    <>
    <Section ref={ref}>
        <CardContainer>
            <Grid container spacing={3}>
                    <Grid item xs={12} sm={6} md={4} lg={3}><MyCard img={img1} alt={"1"} text={"A Brief History"} /></Grid>
                    <Grid item xs={12} sm={6} md={4} lg={3}><MyCard img={img2} alt={"1"} text={"Introduction"} /></Grid>
                    <Grid item xs={12} sm={6} md={4} lg={3}><MyCard img={img3} alt={"1"} text={"Independence of Horizontal and Vertical Velocity"} /></Grid>
                    <Grid item xs={12} sm={6} md={4} lg={3}><MyCard img={img4} alt={"1"} text={"Formation of Orbits"} /></Grid>
                    <Grid item xs={12} sm={6} md={4} lg={3}><MyCard img={img5} alt={"1"} text={"Centripetal Force"} /></Grid>
                    <Grid item xs={12} sm={6} md={4} lg={3}><MyCard img={img6} alt={"1"} text={"What happens if there is no Centripetal Force?"} /></Grid>
                    <Grid item xs={12} sm={6} md={4} lg={3}><MyCard img={img7} alt={"1"} text={"The Barycentre"} /></Grid>
                    <Grid item xs={12} sm={6} md={4} lg={3}><MyCard img={img8} alt={"1"} text={"Experiments on Centripetal Force"} /></Grid>
                    <Grid item xs={12} sm={6} md={4} lg={3}><MyCard img={img9} alt={"1"} text={"Mathematical Formulation of Gravity"} /></Grid>
                    <Grid item xs={12} sm={6} md={4} lg={3}><MyCard img={img10} alt={"1"} text={"How was the Universal Gravitation Constant Determined?"} /></Grid>
                    <Grid item xs={12} sm={6} md={4} lg={3}><MyCard img={img11} alt={"1"} text={"A Little Help from Kepler"} /></Grid>
                    <Grid item xs={12} sm={6} md={4} lg={3}><MyCard img={img12} alt={"1"} text={"Experiments on Freefall"} /></Grid>
                    <Grid item xs={12} sm={6} md={4} lg={3}><MyCard img={img13} alt={"1"} text={"Understanding Freefall"} /></Grid>
                    <Grid item xs={12} sm={6} md={4} lg={3}><MyCard img={img14} alt={"1"} text={"Mass vs Weight"} /></Grid>
                    <Grid item xs={12} sm={6} md={4} lg={3}><MyCard img={img15} alt={"1"} text={"Weight on other planets"} /></Grid>
                    <Grid item xs={12} sm={6} md={4} lg={3}><MyCard img={img16} alt={"1"} text={"Thrust vs Pressure"} /></Grid>
                    <Grid item xs={12} sm={6} md={4} lg={3}><MyCard img={img17} alt={"1"} text={"Pressure in Fluids"} /></Grid>
                    <Grid item xs={12} sm={6} md={4} lg={3}><MyCard img={img18} alt={"1"} text={"Experiments on Buoyancy"} /></Grid>
                    <Grid item xs={12} sm={6} md={4} lg={3}><MyCard img={img19} alt={"1"} text={"Buoyancy"} /></Grid>
                    <Grid item xs={12} sm={6} md={4} lg={3}><MyCard img={img20} alt={"1"} text={"Archimedes' Principle"} /></Grid>
                    <Grid item xs={12} sm={6} md={4} lg={3}><MyCard img={img21} alt={"1"} text={"Experiment on Density"} /></Grid>
                    <Grid item xs={12} sm={6} md={4} lg={3}><MyCard img={img22} alt={"1"} text={"Density"} /></Grid>
                    <Grid item xs={12} sm={6} md={4} lg={3}><MyCard img={img23} alt={"1"} text={"Summary"} /></Grid>
                    <Grid item xs={12} sm={6} md={4} lg={3}><MyCard img={img24} alt={"1"} text={"Questions"} /></Grid>
                

            </Grid>
            


        </CardContainer>
    
    </Section>
    </>
  )
}

export default Topics
